package datastructures.Arrays;

public class ArrayEg1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] arr; String[] s;
		arr = new int[20];
		s = new String[20];
		
		for(int i : arr) {
			System.out.println(i);
		}
		
		for(String s1 : s) {
			System.out.println(s1);
		}
		
	}

}
